import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { SafeAreaView, Text } from "react-native";
// If you already have a root navigator, import it:
let RootNav: React.ComponentType | null = null;
try {
  // adjust if your file is named differently
  RootNav = require("./src/navigation").default;
} catch {}

export default function App() {
  if (RootNav) {
    return (
      <NavigationContainer>
        <RootNav />
      </NavigationContainer>
    );
  }
  // Fallback UI so something renders even before nav is wired
  return (
